import React, { useState } from 'react';
import { Outlet, Link } from "react-router-dom";
import "./Navbar.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell, faChevronLeft, faUser } from '@fortawesome/free-solid-svg-icons';
import LogoIcon from '../images/Cavero_Icon.png';

function Navbar() {

    const [open, setOpen] = useState(true);
  const Menus = [
    { title: "Dashboard", src: "Chart_fill" },
    { title: "Inbox", src: "Chat" },
    { title: "Accounts", src: "User", gap: true },
    { title: "Schedule ", src: "Calendar" },
    { title: "Search", src: "Search" },
    { title: "Analytics", src: "Chart" },
    { title: "Files ", src: "Folder", gap: true },
    { title: "Setting", src: "Setting" },
  ];
  return (
    <div className='navbar-container'>
        <div className='side-navbar-container'>
            <div className='brand-container'>
                <img src={LogoIcon} className='brand-img' alt='Cavero'/>
                <div className='brand-name'>
                    Cavero<br/>IT Consultancy
                </div>
                <div className='brand-minimize-navbar'>
                    <a href='#'>
                            <FontAwesomeIcon icon={faChevronLeft} color='white' size='xl'/>
                    </a>
                </div>
            </div>
        </div>
        <div className='top-navbar-container'>
            <nav>
                <ul>
                    <li>
                        <FontAwesomeIcon icon={faBell}/>
                    </li>
                    <li>
                        <a>Hallo, Karsten <FontAwesomeIcon icon={faUser}/></a>
                    </li>
                </ul>
            </nav>
        </div>
        <Outlet />
    </div>
    
  );
}

export default Navbar;
